import React from "react";
import StudentsCompanent from "./StudentsCompanent.jsx";
import { connect } from "react-redux";
import  { getStudent, deleteStudent, filterStudent }  from "../../reduser/data-reduser.js";

class StudentsContainer extends React.Component {

  componentDidMount() {
    this.props.getStudent();
  }

  render() {
    return (
      <StudentsCompanent
        students={this.props.students}
        deleteStudent={this.props.deleteStudent}
        filterStudent={this.props.filterStudent}
      />
    );
  }
}

const mapStateToProps = (state) => ({
  students: state.data.students,
});

export default connect(mapStateToProps, { getStudent, deleteStudent, filterStudent })(StudentsContainer);
